<div class="art-article"><p><img src="http://mathdept.znu.edu.ua/plugins/content/jumultithumb/img/Li4vLi4vLi4vLi4vaW1hZ2VzL3RvZG9yaWtvLmpwZyZ3PTMwMCZoPTIwMCZxPTkwJmFvZT0x.jpg" alt="todoriko"width="250" height="200" class="juimage juimg-article" /></p>
<p style="text-align: justify;">Колектив Запорізького національного університету вітає старшого викладача кафедри інформаційних технологій Ольгу Олексіївну Тодоріко з успішним захистом дисертації «Моделі та методи очищення та інтеграції текстових даних в інформаційних системах» на здобуття наукового ступеня кандидата технічних наук зі спеціальності 05.13.06 – «Інформаційні технології».</p>
 
<p style="text-align: justify;">Захист відбувся 30 червня 2016 року на засіданні спеціалізованої вченої ради Д 64.050.07 у Національному технічному університеті «Харківський політехнічний інститут». Науковий керівник – доктор технічних наук, професор, декан математичного факультету Запорізького національного університету Сергій Іванович Гоменюк.<br />Бажаємо подальших професійних успіхів і досягнень!</p>
<p>&nbsp;</p></div>
